// src/pages/Products.jsx
import React, { useEffect, useState } from "react";
import { useNavigate } from "react-router-dom";
import "../styles/Products.css"; // üëà Assure-toi que le CSS est bien import√©

const Products = () => {
  const navigate = useNavigate();
  const [products, setProducts] = useState([]);
  const [loading, setLoading] = useState(true);

  useEffect(() => {
    const fetchProducts = async () => {
      try {
        const API_URL = "http://localhost:5000/api";
        const token = localStorage.getItem("token");

        if (!token) {
          alert("Non authentifi√©. Veuillez vous connecter.");
          window.location.href = "/";
          return;
        }

        const res = await fetch(`${API_URL}/products`, {
          method: "GET",
          headers: {
            "Content-Type": "application/json",
            Authorization: `Bearer ${token}`,
          },
        });

        if (!res.ok) {
          if (res.status === 401) {
            alert("Session expir√©e ou non autoris√©.");
            window.location.href = "/";
            return;
          }
          throw new Error("Erreur serveur");
        }

        const data = await res.json();

        if (data.success && Array.isArray(data.data)) {
          setProducts(data.data);
        } else {
          throw new Error("Format de r√©ponse invalide");
        }
      } catch (error) {
        console.error("Erreur chargement produits:", error);
        alert("Impossible de charger les produits.");
      } finally {
        setLoading(false);
      }
    };

    fetchProducts();
  }, []);

  if (loading) {
    return (
      <div className="products-page">
        <div className="loading">Chargement des produits...</div>
      </div>
    );
  }

  return (
    <div className="products-page">
      <div className="products-header">
        <div>
          <h1>Gestion des produits</h1>
          <p>Liste compl√®te des produits internes et fournisseurs</p>
        </div>

         
      </div>

      <div className="table-wrapper">
        <table className="products-table">
          <thead>
            <tr>
              <th>Nom</th>
              <th>Description</th>
              <th>Prix</th>
              <th>Quantit√©</th>
              <th>Actions</th>
            </tr>
          </thead>

          <tbody>
            {products.length === 0 ? (
              <tr>
                <td colSpan="5" className="empty-message">
                  Aucun produit trouv√©.
                </td>
              </tr>
            ) : (
              products.map((p) => (
                <tr key={p._id || p.id}>
                  <td>{p.name}</td>
                  <td>{p.description}</td>
                  <td>{p.price} DT</td>
                  <td
                    className={
                      p.quantity < 5
                        ? "quantity low-stock"
                        : "quantity"
                    }
                  >
                    {p.quantity}
                  </td>
                  <td className="actions-cell">
                    <button
                      className="edit-btn"
                      onClick={() =>
                        navigate(`/update-product/${p._id || p.id}`)
                      }
                    >
                      Modifier
                    </button>

                    <button
                      className="delete-btn"
                      onClick={() => {
                        if (window.confirm("Confirmer la suppression ?")) {
                          console.log("Supprimer produit", p._id || p.id);
                        }
                      }}
                    >
                      Supprimer
                    </button>
                  </td>
                </tr>
              ))
            )}
          </tbody>
        </table>
      </div>
    </div>
  );
};

export default Products;
